  true,\n\t\"url\": null,\n\t\"notes\": \"The US Department of Energy (DOE), via the
  office of Energy Efficiency and Renewable Energy (EERE), publishes an annual Renewable
  Energy Data Book. Provided here is the data corresponding to the 2010 Renewable
  Energy Data Book. The types of data available include: US energy production and
  consumption (2000 - 2009) for all fuel sources (coal, natural gas, petroleum, nuclear,
  hydro, and non-hydro renewables); total consumption by sector; US renewable energy
  capacity and generation (2000 - 2009); as well as global renewable energy capacity
  and generation (2000 - 2009).\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
